import React, { useContext } from "react";
import AppContext from "../AppContext";
import memes from "../data";

function Regular() {
  const { memes } = useContext(AppContext);
  const regularMemes = memes.map((mem) => {
    return <mem key={mem.id} mem={mem} />;
  });
  return (
    <div>
      <p>Regular</p>
      {regularMemes}
    </div>
  );
}

export default Regular;
